// Button.js

import React,{ useEffect, useState } from 'react';



function list() {
  const[list , setlist] = useState([])

  useEffect(()=>{

    fetch('http://localhost:8080')
    .then(response => response.json())
    .then(data => setlist(data._embedded))
    .catch(err => console.error(err))

  },[])

  return(
    <div></div>
  );
}

export default Main;
